import React, { useEffect } from "react";
import axios from "axios";

const GetData = async ({ inputform, URL }) => {
  let topic = null;
  try {
    const response = await axios.get(URL);
    topic = await response.json();
  } catch (err) {
    console.log(err);
    topic = [];
  }

  return (
    <div>
      <h1></h1>
    </div>
  );
};

export default GetData;
